import React from 'react';
import { FormControlLabel, Checkbox } from '@mui/material';

const OrderStatus = ({ status, isSorted, onSortChange }) => {
  const handleSortChange = (e) => {
    const isChecked = e.target.checked;
    console.log(`Sort marker: ${isChecked}, Field: status, Value: ${status}`);
    onSortChange('status', isChecked, status);
  };

  return (
    <div>
      <span>{status}</span>
      <FormControlLabel
        control={<Checkbox checked={Boolean(isSorted)} onChange={handleSortChange} />}
        label="Сортировка"
      />
    </div>
  );
};

export default OrderStatus;
